import React from 'react';
import Head from 'next/head';
import Nav from '../components/nav';
import Footer from '../components/footer';

const Home = () => (
  <div>
    <Head>
      <title>Home</title>
      <link rel="icon" href="/favicon.ico" />

      <link href='https://fonts.googleapis.com/icon?family=Material+Icons' rel='stylesheet'></link>

      <link rel='stylesheet' href='https://cdnjs.cloudflare.com/ajax/libs/materialize/1.0.0-alpha.3/css/materialize.min.css'></link>
    </Head>

    <Nav />
    <div className='container'>
      <div className="hero center">
        <h1 className='title'>Let's talk bussines</h1>
        <p className='description'>
          Aprender idiomas tambien puede ser redituable
        </p>
      </div>
    </div>

    <div className='row'>
        <div className='col s3 m7'>
        <div className='card'>
            <div className="card-image">
                <img src='images/boy-1.png'></img>
                <span className='card-title'>Card Title</span>
            </div>
            <div className='card-content'>
                <p>I am a very simple card. I am good at containing small bits of information.
                I am convenient because I require little markup to use effectively.</p>
            </div>
            <div className='card-action'>
            <a href="#">This is a link</a>
            </div>
        </div>
        </div>
    </div>


    <Footer />
    <style jsx>{`
        .description {
          font-size: 30px;
          font-style: italic;
          font-weight: 300;
        }
        body {
          display: flex;
          min-height: 100vh;
          flex-direction: column;
        }

        main {
          flex: 1 0 auto;
        }
        .card img{
            height: 250px;
            width: auto;
        }
      `}</style>
  </div>

)

export default Home
